import { Box, Flex, VStack } from '@chakra-ui/react';
import { BsPersonFill } from 'react-icons/bs';
import React from 'react';

const Workouts = () => {
	return (
		<VStack>
			<Box bg="gray" p="2">
				<BsPersonFill size="40" />
			</Box>
			<VStack>
				<Text>Deniz Kaptan</Text>
				<Text>Pull 1 | Week 1</Text>
				<Text>Friday</Text>
			</VStack>
		</VStack>
	);
};

export default Workouts;
